import React, { Component } from 'react';

export default class Home extends Component{
    render() {
        return(
            <>
                <h1><center>Projects</center></h1>
                <div>
                    <ul>
                        <Link to="https://github.com/Joeyryanbridges">
                            <Image src="giticon.png" className="githubIcon" />
                        </Link>
                        <img src="https://gbksoft.com/blog/wp-content/uploads/2019/07/trading-984x555.png" alt="Algorithmic Trading Pic" width="400" height="275"/>
                    </ul>
                </div>

            </>
        )
    }
}
